import React from "react";
import styled from "styled-components";
import { Carousel } from "react-bootstrap";

const Carousel_img = () => {
const style = {height :"75rem"}
  return (
    <>
      <Wrapper>
        <Carousel interval={1000}>
          <Carousel.Item>
            <img 
            style={style}
              className="d-block w-100"
              src="./images/bg1.jpg"
              alt="First slide"
            />
          </Carousel.Item>
          <Carousel.Item>
            <img 
            style={style}
              className="d-block w-100"
              src="https://ftechiz.com/wp-content/uploads/2022/08/Software-min.jpg"
              alt="Second slide"
            />
          </Carousel.Item>
          <Carousel.Item>
            <img 
            style={style}
              className="d-block w-100"
              src="./images/bg3.jpg"
              alt="Third slide"
            />
          </Carousel.Item>
          <Carousel.Item>
            <img 
            style={style}
              className="d-block w-100"
              src="./images/bg4.jpg"
              alt="Third slide"
            />
          </Carousel.Item>
        </Carousel>

      </Wrapper>
    </>
  );
};
const Wrapper = styled.section`
  padding: 5rem 0;

`;
export default Carousel_img;
